import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import MenuItem from '@material-ui/core/MenuItem';
import Menu from '@material-ui/core/Menu';
import MoreIcon from '@material-ui/icons/MoreVert'; 
import PropTypes from 'prop-types';
import Btn from '../Button/Btn';

const useStyles = makeStyles((theme) => ({
nav :{
    margin : "auto",
    justifyContent : "center",
    background: (props) =>
    props.color === 'tranparent'
      ? 'transparent'
      : '#fff',
    boxShadow: '0 3px 5px 2px rgba(0, 0, 0, .1)',
    color: (props) => 
    props.color === 'transparent'
    ? 'white'
    : '#5C0090',
    height: 80,
    width : "100%"
    },
  grow: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    display: 'none',
    [theme.breakpoints.up('md')]: {
      display: 'block',
    },
  },
  sectionDesktop: {
    display: 'none',
    [theme.breakpoints.up('md')]: {
      display: 'flex',
    },
  },
  sectionMobile: {
    display: 'flex',
    [theme.breakpoints.up('md')]: {
      display: 'none',
    },
  },
}));

function Navbar(props) {
    const { color, ...other } = props;
    const classes = useStyles(props);
    return <AppBar className={classes.root} {...other} />;
  }
  
  Navbar.propTypes = {
    color: PropTypes.oneOf(['trasparent', 'white']).isRequired,
  };

export default function PrimarySearchAppBar() {
  const classes = useStyles();
  const [anchorEl, setAnchorEl] = React.useState(null);
  const [mobileMoreAnchorEl, setMobileMoreAnchorEl] = React.useState(null);

  const isMenuOpen = Boolean(anchorEl);
  const isMobileMenuOpen = Boolean(mobileMoreAnchorEl);

  const handleMobileMenuClose = () => {
    setMobileMoreAnchorEl(null);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
    handleMobileMenuClose();
  };

  const handleMobileMenuOpen = (event) => {
    setMobileMoreAnchorEl(event.currentTarget);
  };

  const menuId = 'courses';
  const renderMenu = (
    <Menu
      anchorEl={anchorEl}
      anchorOrigin={{ vertical: 'top', horizontal: 'right' }}
      id={menuId}
      keepMounted
      transformOrigin={{ vertical: 'top', horizontal: 'right' }}
      open={isMenuOpen}
      onClose={handleMenuClose}
    >
      <MenuItem onClick={handleMenuClose}>Profile</MenuItem>
      <MenuItem onClick={handleMenuClose}>My account</MenuItem>
    </Menu>
  );

  const mobileMenuId = 'primary-search-account-menu-mobile';
  const renderMobileMenu = (
    <Menu
      anchorEl={mobileMoreAnchorEl}
      anchorOrigin={{ vertical: 'top', horizontal: 'right' }}
      id={mobileMenuId}
      keepMounted
      transformOrigin={{ vertical: 'top', horizontal: 'right' }}
      open={isMobileMenuOpen}
      onClose={handleMobileMenuClose}
    >
    <MenuItem>Courses</MenuItem>
    <MenuItem>Tracks</MenuItem>
    <MenuItem>Blogs</MenuItem>
    <MenuItem>Login</MenuItem>
    <MenuItem>Signup</MenuItem>
    </Menu>
  );

  return (
    <div className={classes.grow}>
      <AppBar position="sticky" className = {classes.nav}>
        <Toolbar>
          <Typography variant="h1" noWrap>
            Coursenator
          </Typography>
          <div className={classes.grow} />
          <div className={classes.sectionDesktop}>
              <MenuItem>Courses</MenuItem>
              <MenuItem>Tracks</MenuItem>
              <MenuItem>Blogs</MenuItem>
              <MenuItem>Login</MenuItem>
              <Btn color = "white">Signup</Btn>
          </div>
          <div className={classes.sectionMobile}>
            <IconButton
              aria-label="show more"
              aria-controls={mobileMenuId}
              aria-haspopup="true"
              onClick={handleMobileMenuOpen}
              color="inherit"
            >
              <MoreIcon />
            </IconButton>
          </div>
        </Toolbar>
      </AppBar>
      {renderMobileMenu}
      {renderMenu}
    </div>
  );
}
